const Header = (props) => {
  console.log(props);
  return (
    <div>
      <p>The course name is {props.course}</p>
    </div>
  );
};

const Part = (props) => {
  console.log(props);
  return (
    <p>
      {props.part}
    </p>
  );
};

const Content = (props) => {
  return (
    <div>
      The part name is <Part part={props.parts[0].name} />, and the number of exercises of this part is <Part part={props.parts[0].exercises} />
    </div>
  );
};

const App = () => {
  const course = 'Half Stack application development';
  const parts = [
    { name: 'Fundamentals of React', exercises: 10 },
    { name: 'Using props to pass data', exercises: 7 },
    { name: 'State of a component', exercises: 14 }
  ];

  return (
    <div>
      <Header course={course} />
      <Content parts={parts} />
    </div>
  );
};

export default App;
